import React from 'react';
function NotFound() {
    return ( 
        <>
        <div className="container p-5" style={{width:"100%", height:"82vh"}}>
            <div className="row text-center mt-5 p-5">
                <h1 className='fs-1'>404</h1>
                <p>Oops! Page not found</p>
            </div>
        </div>
        </>
     );
}

export default NotFound;
